TRUNCATE TABLE replication_tampon.diapason_contacts_unitaires;

TRUNCATE TABLE marketing.sas_collecte_externe;

\copy contact(email,
source,
campagne_collecte,
date_collecte,
tel_fixe,
tel_mobile,
optin_email,
optin_sms,
date_naissance,
civilite,
nom,
prenom,
adresse1,
adresse2,
codepostal,
ville,
pays,
text_01,
text_02,
text_03,
date_01,
date_02,
date_03,
numerique_01,
numerique_02,
numerique_03
) FROM '/home/centos/samples/contact_collecte.csv' DELIMITER '|' CSV HEADER;

select code_client as src, first_value(code_client) over(partition by email order by code_client) as tgt
from contact
union
select code_client as src, first_value(code_client) over(partition by tel_portable order by code_client) as tgt
from contact;